import React from "react";
import foodwaste from "../images2/foodwaste.jpeg";
import foodwaste2 from "../images2/foodwaste2.jpeg";
function OurMission(props) {
  return (
    <>
      <div>
        <h1>THE FOOD WASTE MOVEMENT</h1>
        <h2> MORE THAN 1/3 OF FOOD IS WASTED</h2>
        <img src={foodwaste} />
        <h3>
          "Reducing food waste is one of the most important things we can do to
          reverse global warming." - Chad Frischmann, Climate Change Expert
        </h3>
        <h1>VISIT OUR GLOBAL MOVEMENT WEBSITE</h1>
        <img src={foodwaste2} />
        <h2>
          We are currently working on a food waste movement website specifically
          for the UK. It will be jampacked with interesting stats, useful
          information and engaging content. Stay tuned for more news... coming
          soon!
        </h2>
        <img src={foodwaste2} />
      </div>
    </>
  );
}

export default OurMission;
